<h1>О нас</h1>
<p>
    E-shelter - это приют для бездомных в Южно-восточном округе г. Москвы. Сейчас в нем живет около 20 собак. Большие и маленькие, пушистые и гладкие, веселые и задумчивые - и на всех одна большая мечта - встретить своего человека и найти Дом.
</p>
<p>
    Приют совсем недавно начал свой путь и пока не имеет громкого имени или лучшего места. Мы начали свою неосознанную деятельность в 2019 году, подобрав несколько выброшенных на улицу щенков к себе домой, поскольку оставить их было невозможным, было решено начать поиск нового дома для бедных животных. С этого началась дорога, полная различных преград и продолжающая прокладываться и по сей день.
</p>
<p>
    Приют предоставляет возможность людям выбрать себе друзей, и хотя говорят, что друзей не выбирают , однако в нашем случае выбор будет взаимовыгодным для двух сторон.
</p>
<p>
    В наших стенах вы можете оставить своего друга на время вашего отсутствия в городе. Мы с особой заботой и профессионализмом позаботимся о вашем пито");
            WriteLiteral(@"мце и вам не придется волноваться о его состоянии.
</p>
<p>
    Поскольку непредвиденные ситуации это обычное дело, мы также сможем приютить и подыскать вашему найденышу место рядом со своим человеком. В случае, если вы нашли раненую, бездомную или брошенную собаку - обращайтесь к нам. Мы сделаем все что в наших силах чтобы помочь новому жильцу. Также вы можете без утайки передать в надежные руки своего друга, если в вашей жизни появились непосильные для вас трудности. Мы непременно поможем вам и вашей собаке всем, чем сможем.
</p>
<p>
    Одними из постоянных трудностей являются финансовые вопросы, так как за деньги мы приобретаем игрушки для животных, еду, бытовые средства необходимости и так далее. Если у вас есть желание и возможность там помочь, а сделать это очень просто - передать нам корма или крупы, и этого уже будет более чем достаточно. Также мы принимаем волонтеров в свои ряды.
</p>
